// Page2/index.js
import React from 'react';
import './index.css';
import { useLocation } from 'react-router-dom';

function Page2() {
    const use_location = useLocation()
    return (
        <div>
        <h1>當前頁面路徑是: {use_location.pathname}</h1>
        page2
        </div>
    );
}

export default Page2;
